func findIncrement(coords []int) int {
	if len(coords) < 2 {
		return 0
	}
	var increments []int
	for i := 1; i < len(coords); i++ {
		diff := coords[i] - coords[i-1]
		if diff > 0 { // Assuming no negative increments and skipping zero increments
			increments = append(increments, diff)
		}
	}
	if len(increments) == 0 {
		return 0
	}
	sort.Ints(increments) // Sort the increments to find the smallest non-zero increment
	return increments[0]  // The smallest increment
}
